import React from "react";

function ConfirmationDialog({ appointment, onDelete, onCancel }) {
  return (
    <div className="confirmation-dialog" style={{backgroundColor:"#C8FFE0", borderRadius: "30px", zIndex: "9999", position:"fixed", top:"10px", left:"0",display:"flex", width: "100%",
    height: "100%", justifyContent:"center", alignItems:"center"}}>
      <div className="confirmation-content">
      <h3>Confirm Deletion</h3>
      <p>Appointment Date: {appointment.date}</p>
      <p>Appointment Time: {appointment.time}</p>
      <button onClick={onDelete}>Delete</button>
      <button onClick={onCancel}>Cancel</button>
      </div>

    </div>
  );
}

export default ConfirmationDialog;
